	[30060096] = {30060096,1,[[梅絲忒]],"Minstrel ",'',[[是我準備的，因為猜到你們斯諾普之眼才不會幫指揮官準備作戰服。]],'',0,"0,920001,0,1029900,0","0,0,0,0,0","0,3,0,8,0","0,0,0,3,0",'',1,"bg_1_story_10010",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30060097] = {30060097,1,[[薩拉托加]],"Saratoga",'',[[我們可是要立志拯救世界的組織，不是什麼保母團體啦，準備衣服這種事情交給你就好，你看，這不是做得挺好的嗎。]],'',0,"0,920001,0,1029900,0","0,0,0,0,0","0,3,0,9,0","0,1,0,3,0",'',1,"bg_1_story_10010",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30060098] = {30060098,1,'','','',[[怎麼說呢，雖然是隔著螢幕，還是聞到了一絲火藥味。]],'',0,"0,920001,0,1029900,0","0,0,0,0,0","0,3,0,9,0","0,0,0,3,0",'',1,"bg_1_story_10010",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30060099] = {30060099,1,[[梅絲忒]],"Minstrel ",'',[[拯救世界？你們什麼時候有如此崇高的理想了。]],'',0,"0,920001,0,1029900,0","0,0,0,0,0","0,3,0,9,0","0,0,0,3,0",'',1,"bg_1_story_10010",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30060100] = {30060100,1,[[薩拉托加]],"Saratoga",'',[[到此為止～我這次通訊也不是為了吵架的，不要那麼緊張嘛～在說正經事之前，薩拉我先代表<color=#64FFFF>斯諾普之眼</color>向你表達親切的慰問——昨天睡得怎麼樣？]],'',0,"0,0,1029900,0,0","0,0,0,0,0","0,0,5,0,0","0,0,3,0,0",'',1,"bg_1_story_10010",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
