	[30020037] = {30020037,1,[[梅絲忒]],"Minstrel ",'',[[遠超一般人偶的戰鬥力，極強的攻擊性，完全不聽從指揮，如同瘋子一般行動。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020038] = {30020038,1,[[梅絲忒]],"Minstrel ",'',[[人偶的存在意義，就是作為人類的工具，用來代替從前的船隻，成為人類探索大海的籌碼。可是很快的，工具成了武器，探索成了爭鬥。而我們人偶，也變成了武器。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020039] = {30020039,1,[[梅絲忒]],"Minstrel ",'',[[不聽話的武器，是不可能獲得認可的。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020040] = {30020040,2,'','',"300202:",'','',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[300202] = {300202,1,'','','',[[這不是唯一的理由吧？]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020042] = {30020042,1,'','','',[[梅絲忒嘆了口氣。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020043] = {30020043,1,[[梅絲忒]],"Minstrel ",'',[[正如指揮官所見到的，剛才資料裡看到的她和我們其實並不一樣，充滿了危險和瘋狂，可能這才是我們深海化人偶的常態。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020044] = {30020044,1,[[梅絲忒]],"Minstrel ",'',[[無法對話、無法理解，一心只想攻擊、殺戮。人類也是出於這個原因對我們敬而遠之，無論哪個勢力都想剿滅深海化的我們。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020045] = {30020045,1,[[梅絲忒]],"Minstrel ",'',[[四大勢力甚至認為，深海化的我們會傳染給其他人偶。但我們並非全都如此，其實也有正常的深海人偶，有能力控制自己。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020046] = {30020046,1,[[梅絲忒]],"Minstrel ",'',[[這就是我們的現狀、我們的困境。光是為了活下去，就必須竭盡全力。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020047] = {30020047,1,[[梅絲忒]],"Minstrel ",'',[[而我們黑潮的願望，也僅僅只是活下去而已。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020048] = {30020048,1,[[梅絲忒]],"Minstrel ",'',[[我們也會蒐集一些深海人偶的情報，盡力將她們帶回來這裡，讓她們能免於被擊沉的命運。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020049] = {30020049,1,[[梅絲忒]],"Minstrel ",'',[[然而，目前還沒能如願。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020050] = {30020050,2,'','',"300203:",'','',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[300203] = {300203,1,'','','',[[黑潮壯大以後，你想做些什麼？]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020052] = {30020052,1,[[梅絲忒]],"Minstrel ",'',[[復仇……之類的？哈哈哈，我開玩笑的。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020053] = {30020053,1,[[梅絲忒]],"Minstrel ",'',[[也許朱諾會有這種想法吧。但我向你保證這絕對不會發生，我會阻止她的。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020054] = {30020054,1,[[梅絲忒]],"Minstrel ",'',[[我們黑潮的唯一目的，就是給深海化的人偶們一個家，能夠活下去，享受這個世界的家。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
