	[300204] = {300204,1,'','','',[[深海化，究竟是什麼？]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020057] = {30020057,1,[[梅絲忒]],"Minstrel ",'',"……",'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020058] = {30020058,1,[[梅絲忒]],"Minstrel ",'',[[說實話，我並不知道，就連我自己屬於哪一邊，都不太清楚。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020059] = {30020059,1,[[梅絲忒]],"Minstrel ",'',[[我們對此現象的瞭解並不比人類多，只知道她們相當暴戾、瘋狂，會撕碎眼前的所有生物。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020060] = {30020060,1,[[梅絲忒]],"Minstrel ",'',[[同時也有能避免這種情況，深海化後還保持著理智的人偶。而她們有許多人都接觸到了一些……過去的記憶。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020061] = {30020061,1,[[梅絲忒]],"Minstrel ",'',[[身為船的記憶。其中包含著戰鬥的激昂、被擊沉的不甘，甚至是憤恨。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020062] = {30020062,1,[[梅絲忒]],"Minstrel ",'',[[或許，被這本不屬於自己的情感所控制，左右了自己行動的人偶，就會變成那種樣子吧……]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30020063] = {30020063,1,[[梅絲忒]],"Minstrel ",'',[[又或許，這才是她們應該成為的樣子也說不定？]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
