	[30020065] = {30020065,1,[[梅絲忒]],"Minstrel ",'',[[真是對不起，自顧自地說了這麼久。已經很久沒有人願意聽我說這些事了。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
