	[30030003] = {30030003,1,[[梅絲忒]],"Minstrel ",'',[[……你可能已經猜到了，這個故事的主角，就是朱諾的姐姐。你剛才在影片資料裡看到的也是她，只不過是已經深海化的她。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030004] = {30030004,2,'','',"300301:",'','',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[300301] = {300301,1,'','','',[[那她現在在哪裡？]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030005] = {30030005,1,[[梅絲忒]],"Minstrel ",'',[[沒人知道，這段資料是我們所能取得的最後影像了。亞特蘭大擊垮神代的部隊以後就消失了，再也沒有出現，任何勢力的資料中都沒有目擊報告。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030006] = {30030006,1,[[我]],'','',"……",'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030007] = {30030007,1,[[梅絲忒]],"Minstrel ",'',[[關於這段影像，還請不要告訴朱諾。她本就對活下來的自己充滿了厭惡，姐姐還活著可以說是她唯一的希望了。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030008] = {30030008,1,[[梅絲忒]],"Minstrel ",'',[[或許也是這個原因，讓她得以突破負面情緒的束縛，才沒變成亞特蘭大那個樣子。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030009] = {30030009,1,'','','','','',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030010] = {30030010,1,[[梅絲忒]],"Minstrel ",'',[[不過即使並未遭負面情緒吞噬，朱諾和朱比特她們，多少也受了一點影響。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[30030011] = {30030011,1,[[梅絲忒]],"Minstrel ",'',[[她們作為人偶存活在這個世界上的方法和意義，希望指揮官能夠幫助她們找到。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_story_10050",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
