	[30130050] = {30130050,1,[[大和]],"Yamato",'',[[總、總之！吾姑且也算幫助了你們逃脫神代追兵，你們總得有點表示吧？]],'',0,"0,0,6023800,0,0","0,0,0,0,0","0,0,4,0,0","0,0,0,0,0",'',1,"bg_1_story_10021",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
