	[30320006] = {30320006,1,[[親潮]],"Oyashio",'',[[指揮官，現在要怎麼辦？]],'',0,"5043000,0,5003100,0,3019100","1,0,0,0,1","0,0,0,0,0","4,0,1,0,1",'',1,"bg_1_story_10021",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
