	[12040001] = {12040001,1,[[梅絲忒]],"Minstrel ",'',[[指揮官，您現在看到的地圖，是這個世界的海域範圍。]],'',0,"0,920001,0,0,0","0,2,0,0,0","0,0,0,0,0","0,4,0,0,0",'',1,'','','','','','',"920001/stv_12040001",'',1,1,0,0,'',0,0,'','',"guide_chapter158_193",0,},
