	[52500024] = {52500024,1,[[聖地牙哥]],"San Diego",'',[[這次我倒要親眼看看，這個偶像大人有什麼稀奇的……先說好，我和你們可不一樣。]],'',0,"3019000,0,3001000,0,3009000","1,0,1,0,0","0,0,0,0,2","1,0,1,0,0",'',1,"bg_1_story_10035","1,1",'','','','','','',1,1,0,0,'',0,0,'','','',0,},
