	[52520011] = {52520011,1,'','','',[[亞特蘭大眺望大海的視窗剛好是整個房間唯一的光源入口。]],'',0,"0,3009900,0,3001000,0","0,0,0,1,0","0,3,0,0,0","0,0,0,0,0",'',1,"bg_1_story_10031",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[52520012] = {52520012,1,'','','',[[月光支撐著聖地牙哥閱讀她下午剛拿到的新書——《戰爭史》。亞特蘭大的位置剛好稍微擋住了月光。]],'',0,"0,3009900,0,3001000,0","0,0,0,1,0","0,3,0,0,0","0,0,0,0,0",'',1,"bg_1_story_10031",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[52520013] = {52520013,1,[[亞特蘭大]],"Atlanta",'',[[……對不起。]],'',0,"0,3009900,0,3001000,0","0,0,0,2,0","0,3,0,0,0","0,1,0,0,0",'',1,"bg_1_story_10031",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[52520014] = {52520014,1,'','','',[[亞特蘭大稍微移開了一點位置，將唯一的光源還給了自己的妹妹，但是聖地牙哥卻似乎暫時對書沒了興趣。]],'',0,"0,3009900,0,3001000,0","0,0,0,1,0","0,3,0,0,0","0,0,0,7,0",'',1,"bg_1_story_10031",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
