	[52520040] = {52520040,1,[[聖地牙哥]],"San Diego",'',[[還以為你要說什麼，結果就是這種無趣的事情嗎，連看書的興致都被攪亂了。睡覺睡覺。]],'',0,"0,3009900,0,3001000,0","0,0,0,1,0","0,8,0,0,0","0,0,0,1,0",'',1,"bg_1_story_10031",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
