	[52530007] = {52530007,1,'','','',[[時隔半年，因為理念的分歧，兩人已經漸行漸遠。]],'',0,"0,0,3009900,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10032",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[52530008] = {52530008,1,'','','',[[因為戰功的不斷提高，二年生的聖地牙哥破例提前進入三年生的編隊。]],'',0,"0,0,3009900,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10032",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
