	[52530011] = {52530011,1,'','','',[[對她來說，與以前的區別僅僅只是少了一個能一起稍微聊聊人類的大姐而已。]],'',0,"0,0,3009900,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_story_10032",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
