	[52530019] = {52530019,1,[[哥倫比亞]],"Columbia",'',[[呵呵，上級硬塞二年生進來的時候還不知道會怎麼樣，結果竟然意外地強呢。馬上就可以拿下第二了吧？]],'',0,"0,3033000,0,3009900,0","0,1,0,0,0","0,0,0,7,0","0,0,0,1,0",'',1,"bg_1_story_10034",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[52530020] = {52530020,1,[[聖地牙哥]],"San Diego",'',[[是啊，不過我可不會滿足的，我的目標可是第一呢！但是最近偶像大人是不是太鬆懈了……]],'',0,"0,3033000,0,3009900,0","0,1,0,0,0","0,0,0,7,0","0,1,0,0,0",'',1,"bg_1_story_10034",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
