	[80030017] = {80030017,1,[[梅絲特]],"Minstrel ",'',[[啊對了，說正事。因為大漁祭是神代的祭典，所以除了我們之外，他們也會邀請其他國家的人來參加。]],'',0,"0,920001,0,5043000,0","0,2,0,1,0","0,0,0,0,0","0,3,0,1,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[80030018] = {80030018,1,[[梅絲特]],"Minstrel ",'',[[而我們組織的特殊性你們應該心裡清楚，相信對於神代來說也一樣。在明白這一點的情況下寄送邀請函，他們應該已有對策。]],'',0,"0,920001,0,5043000,0","0,2,0,1,0","0,0,0,0,0","0,3,0,1,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[80030019] = {80030019,1,[[梅絲忒]],"Minstrel ",'',[[到了神代之後，你們必須好好遵從她們的安排，千萬不要擅自行動。我特別擔心朱比特，所以親潮和朱諾一定要好好看住她。]],'',0,"0,920001,0,5043000,0","0,2,0,1,0","0,0,0,0,0","0,3,0,1,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
