	[80100002] = {80100002,1,"Z3","Z3",'',[[姐姐，這裡是哪裡……我們回去吧，好不好？]],'',0,"0,0,0,5051000,0","0,0,0,2,0","0,0,0,0,0","0,0,0,4,0",'',1,"bg_1_story_10036",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
