	[80150061] = {80150061,1,[[親潮]],"Oyashio",'',[[我們也不希望這麼好的祭典遭到破壞。]],'',0,"0,0,5043000,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_10026",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
