	[80170052] = {80170052,1,[[親潮]],"Oyashio",'',[[嗚哇，指揮官哄起小孩功力了得呢。]],'',0,"0,5043000,0,920001,0","0,2,0,1,0","0,0,0,0,0","0,3,0,3,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[80170053] = {80170053,1,[[梅絲忒]],"Minstrel ",'',[[根據資料，你們前方有一大片被水淹沒一半的陸地，或說島嶼；由於已經被水包圍，人類無法在這些地方生活，但是對我們來說是挺不錯的歇腳處。]],'',0,"0,5043000,0,920001,0","0,1,0,2,0","0,0,0,0,0","0,3,0,3,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[80170054] = {80170054,1,[[梅絲忒]],"Minstrel ",'',[[總而言之，前路未卜，前進時請務必小心。就這麼繼續帶領她們前進吧，指揮官。早一天解決，就早一天<color=#64FFFF>回家</color>。]],'',0,"0,5043000,0,920001,0","0,1,0,2,0","0,0,0,0,0","0,3,0,3,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[80170055] = {80170055,1,[[梅絲忒]],"Minstrel ",'',[[黑潮的基地，沒有你們可是冷清了很多。]],'',0,"0,5043000,0,920001,0","0,1,0,2,0","0,0,0,0,0","0,3,0,3,0",'',1,"bg_1_story_10035",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
