	[90010002] = {90010002,1,[[梅絲忒]],"Minstrel ",'',[[而這會逐漸影響她們，將她們拖向意識的深淵。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,2,0,0","0,0,0,0,0",'',1,"bg_1_equ_001",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
	[90010003] = {90010003,1,[[梅絲忒]],"Minstrel ",'',[[承受不住的她們會失去理智，變為人類所恐懼的，殘缺的深海化人偶。]],'',0,"0,0,920001,0,0","0,0,0,0,0","0,0,6,0,0","0,0,0,0,0",'',1,"bg_1_equ_001",'','','','','','','',1,1,0,0,'',0,0,'','','',0,},
