	[70030001] = {70030001,1,[[胡蜂]],"Wasp",'',[[CV-7胡蜂號回來了，雖然我現在看起來面無表情，但我其實很開心的呢！]],'',0,"0,0,1005100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10051/krs10051_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70040001] = {70040001,1,[[蘭利]],"Langley",'',[[銀翼航母蘭利來啦！CV-1的1，是第一的1！後輩，就算你是指揮官，也要尊重我這個大前輩喔！]],'',0,"0,0,1008100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10081/krs10081_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70050001] = {70050001,1,[[企業]],"Enterprise",'',[[CV-6企業號再次歸來，你們可真不厭煩呢，一次次把我從死亡中吵醒。要好好負起責任哦，指揮官！]],'',0,"0,0,1010100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10101/krs10101_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70060001] = {70060001,1,[[好人理查]],"Bon Homme Richard",'',[[艾塞克斯級航空母艦CV-31好人理查向您報到！謝謝您讓我重獲新生，這感覺真是棒極了！]],'',0,"0,0,1011100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10111/krs10111_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70070001] = {70070001,1,[[獨角獸]],"Unicorn",'',[[本小姐就是獨角獸航空母艦，獨一無二的獨角獸小姐。]],'',0,"0,0,1012100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10121/krs10121_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70080001] = {70080001,1,[[艾塞克斯]],"Essex",'',[[很好，我現在幹勁十足。指揮官，要是有什麼想要我做的事就儘管說吧，我艾塞克斯會把它們全都漂亮解決掉的！]],'',0,"0,0,1015100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10151/krs10151_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70090001] = {70090001,1,[[大黃蜂]],"Hornet",'',[[舷號CV-8，約克鎮級航空母艦三號艦，大黃蜂，可……可別叫我學老虎叫哦……]],'',0,"0,0,1018100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10181/krs10181_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70100001] = {70100001,1,[[皇家方舟]],"Ark Royal",'',[[墜入黑暗之時，有種很奇妙的感覺，彷彿受到了神明的召喚，告訴我還有未盡的使命。我回應之後，就變成這副模樣來到這裡了。]],'',0,"0,0,1024100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"10241/krs10241_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70110001] = {70110001,1,[[飛鷹]],"Hiyo",'',[[雖然我不是戰鬥女僕，但是身上仍然留下了這些印記，我是不是作為女僕來說不太合格呢？]],'',0,"0,0,2001100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"20011/krs20011_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70120001] = {70120001,1,[[競技神]],"Hermes",'',[[我是競技與秩序的信使，想要勝利的話，就聽從我的指示吧。說笑了，我對你這樣的強者還是很感興趣的哦～]],'',0,"0,0,2002100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"20021/krs20021_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70130001] = {70130001,1,[[千歲]],"Chitose",'',[[不知現在這副樣子，還能不能好好品酒呢……但我對指揮官可是始終如一哦。]],'',0,"0,0,2003100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"20031/krs20031_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70140001] = {70140001,1,[[亞特蘭大]],"Atlanta",'',[[亞特蘭大級輕型巡洋艦首艦，亞特蘭大歸來，敵艦剩下幾艘了？]],'',0,"0,0,3001100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30011/krs30011_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70150001] = {70150001,1,[[利安德]],"Leander",'',[[好久不見了，指揮官大人，這副模樣是不是讓您更有安全感呢？接下來，就讓利安德來保護您吧。]],'',0,"0,0,3002100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30021/krs30021_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70160001] = {70160001,1,[[克里夫蘭]],"Cleveland",'',[[CL-55克里夫蘭致所有妹妹，我們的原則是零容忍，任何對我們家族的冒犯，都必須十倍奉還！]],'',0,"0,0,3004100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30041/krs30041_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70170001] = {70170001,1,[[川內]],"Sendai",'',[[啊哈，這身姿態讓我全身都輕了很多呢，不過指揮官，有吃的嗎喵，我肚子有點餓的說喵……]],'',0,"0,0,3005100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30051/krs30051_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70180001] = {70180001,1,[[萊比錫]],"Leipzig",'',[[萊比錫級輕巡洋艦1號艦，萊比錫號，呵呵，大概也沒人在乎吧？]],'',0,"0,0,3010100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30101/krs30101_0101",'',1,1,0,0,'',0,0,'','','',0,},
	[70190001] = {70190001,1,[[海王星]],"Neptune",'',[[在黑暗之中，我聽到了許多聲音；有憎恨，有哀嘆，有悲鳴，他們是無家可歸的遊魂，而我……成為了他們的容器。]],'',0,"0,0,3013100,0,0","0,0,2,0,0","0,0,0,0,0","0,0,4,0,0",'',1,"bg_1_story_cg_P5","1,1",'','','','',"30131/krs30131_0101",'',1,1,0,0,'',0,0,'','','',0,},
