function StoryCfgConfig.GetConfig(key)
	local tb = StoryCfgConfig.Values[key]
	if not tb then
		print_error(string.format("key type is %s,key = %s",type(key),key))
		return nil
	end
	local config = {["speakid"] = 1,["speaktype"] = 2,["speakername"] = 3,["speakernameen"] = 4,["select"] = 5,["content"] = 6,["womancontent"] = 7,["resourcejudge"] = 8,["stand"] = 9,["spine"] = 10,["standexpression"] = 11,["standtachieshow"] = 12,["pictureng"] = 13,["type"] = 14,["picture"] = 15,["bgfadeinout"] = 16,["pictureshake"] = 17,["bgm"] = 18,["voice"] = 19,["soundeffect"] = 20,["marryvoice"] = 21,["other"] = 22,["isfastfoward"] = 23,["isskip"] = 24,["autotime"] = 25,["ishideui"] = 26,["twinkle"] = 27,["continue"] = 28,["black"] = 29,["icon"] = 30,["animation"] = 31,["datastatisticskey"] = 32,["nazo"] = 33,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return StoryCfgConfig